import{_ as i,o as l,c as t,a as e}from"./app.aede3185.js";const o="/assets/box-model.8c4e92c0.png",a="/assets/display-position-float.a6f52a50.png",f=JSON.parse('{"title":"CSS\u5E03\u5C40","description":"","frontmatter":{"layout":"post","title":"CSS\u5E03\u5C40","date":"2015-04-19 23:26:00 +0800"},"headers":[{"level":2,"title":"1. box-model","slug":"_1-box-model","link":"#_1-box-model","children":[]},{"level":2,"title":"2. position","slug":"_2-position","link":"#_2-position","children":[]},{"level":2,"title":"3. float","slug":"_3-float","link":"#_3-float","children":[]},{"level":2,"title":"4. display\u3001position\u548Cfloat\u7684\u5173\u7CFB","slug":"_4-display\u3001position\u548Cfloat\u7684\u5173\u7CFB","link":"#_4-display\u3001position\u548Cfloat\u7684\u5173\u7CFB","children":[]},{"level":2,"title":"5. Visual formatting model","slug":"_5-visual-formatting-model","link":"#_5-visual-formatting-model","children":[]},{"level":2,"title":"6. \u53C2\u8003","slug":"_6-\u53C2\u8003","link":"#_6-\u53C2\u8003","children":[]}],"relativePath":"my/post/2015-04-19-css-layout.md"}'),r={name:"my/post/2015-04-19-css-layout.md"},n=e('<h2 id="_1-box-model" tabindex="-1">1. box-model <a class="header-anchor" href="#_1-box-model" aria-hidden="true">#</a></h2><p>\u76D2\u6A21\u578B\u57FA\u672C\u7ED3\u6784\u5982\u56FE\u6240\u793A\uFF1A</p><p><img src="'+o+'" alt=""></p><blockquote><p>\u56FE\u7247\u6765\u6E90\u4E8E<a href="http://www.w3.org/TR/2011/REC-CSS2-20110607/box.html" target="_blank" rel="noreferrer">http://www.w3.org/TR/2011/REC-CSS2-20110607/box.html</a></p></blockquote><ul><li>\u76D2\u5B50\u7684content size\u7531\u8BB8\u591A\u56E0\u7D20\u51B3\u5B9A\uFF0C\u4F8B\u5982\uFF1A\u662F\u5426\u8BBE\u7F6E\u76D2\u5B50\u7684width\u548Cheight\u503C\uFF0C\u76D2\u5B50\u5185\u662F\u5426\u5305\u542B\u6587\u672C\u6216\u5176\u5B83\u76D2\u5B50\uFF0C\u76D2\u5B50\u662F\u5426\u662Ftable\uFF0C\u7B49\u7B49\u3002</li><li>background\u5C5E\u6027\u7684\u4F5C\u7528\u8303\u56F4\u662Fborder box\uFF0Cmargin\u533A\u57DF\u59CB\u7EC8\u662F\u900F\u660E\u7684\u3002</li></ul><p>\u5728\u6709\u4E9B\u60C5\u51B5\u4E0B\uFF0C\u4E24\u4E2A\u6216\u591A\u4E2Abox\uFF08\u53EF\u80FD\u662F\u5144\u5F1F\u5173\u7CFB\uFF0C\u4E5F\u53EF\u80FD\u4E0D\u662F\uFF09\u7684\u76F8\u90BB\u7684margin\u4F1A\u5408\u5E76\u6210\u4E00\u4E2Amargin\uFF0C\u5373margin\u6298\u53E0\u3002\u7AD6\u76F4\u65B9\u5411\u7684margin\u5728\u67D0\u4E9B\u6761\u4EF6\u4E0B\u4F1A\u53D1\u751F\u6298\u53E0\uFF0C\u6C34\u5E73\u65B9\u5411\u7684margin\u6C38\u8FDC\u4E0D\u4F1A\u6298\u53E0\u3002</p><p>\u76F8\u90BB\u7684margin\u6307\u7684\u662F\uFF1A</p><ul><li>\u8FD9\u4E9Bmargin\u6CA1\u6709\u88AB\u975E\u7A7A\u5185\u5BB9\u3001padding\u3001border\u6216clear\u5206\u9694\u5F00\u3002</li><li>\u8FD9\u4E9Bmargin\u5904\u4E8E\u666E\u901A\u6587\u6863\u6D41\u4E2D\uFF0C\u5373\u975E\u6D6E\u52A8\u5143\u7D20\uFF0C\u975E\u5B9A\u4F4D\uFF08absolute\u3001fixed\uFF09\u5143\u7D20\u3002</li><li>\u5904\u4E8E\u7AD6\u76F4\u76F8\u90BB\u7684\u76D2\u5B50\u8FB9\u7F18\uFF0C\u5373\u5C5E\u4E8E\u4EE5\u4E0B\u60C5\u51B5\u4E4B\u4E00\uFF1A <ul><li>\u4E00\u4E2A\u5143\u7D20\u7684top margin\u548C\u5B83\u7684\u7B2C\u4E00\u4E2A\u5B57\u5143\u7D20\uFF08\u5904\u4E8E\u666E\u901A\u6587\u6863\u6D41\u4E2D\uFF09\u7684top margin\u76F8\u90BB\u3002</li><li>\u4E00\u4E2A\u5143\u7D20\u7684bottom margin\u548C\u5B83\u4E0B\u4E00\u4E2A\u5144\u5F1F\u5143\u7D20\uFF08\u5904\u4E8E\u666E\u901A\u6587\u6863\u6D41\u4E2D\uFF09\u7684top margin\u76F8\u90BB\u3002</li><li>\u5982\u679C\u4E00\u4E2A\u5143\u7D20\u7684height\u503C\u4E3Aauto\u4E14min-height\u503C\u4E3A0\uFF0C\u90A3\u4E48\u5B83\u7684bottom margin\u548C\u5B83\u7684\u6700\u540E\u4E00\u4E2A\u5B50\u5143\u7D20\uFF08\u5904\u4E8E\u666E\u901A\u6587\u6863\u6D41\u4E2D\uFF09\u7684bottom margin\u76F8\u90BB\u3002</li><li>\u5982\u679C\u4E00\u4E2A\u5143\u7D20\u7684\u8BA1\u7B97\u540E\u9AD8\u5EA6\u4E3A0\uFF0C\u90A3\u4E48\u5B83\u7684top margin\u548Cbottom margin\u76F8\u90BB\u3002</li></ul></li></ul><p>\u4EE5\u4E0A\u89C4\u5219\u4E5F\u5C31\u662F\u8BF4\uFF1A</p><ul><li>\u6D6E\u52A8\u5143\u7D20\u4E0D\u4F1A\u548C\u5176\u5B83\u4EFB\u4F55\u5143\u7D20\u53D1\u751Fmargin\u6298\u53E0\u3002</li><li>\u521B\u5EFA\u4E86\u65B0\u7684BFC\u7684\u5143\u7D20\uFF08\u4F8B\u5982\u6D6E\u52A8\u5143\u7D20\u548Coverflow\u4E0D\u4E3Avisible\u7684\u5143\u7D20\uFF09\u4E0D\u4F1A\u548C\u5B83\u4EEC\u7684\u5B50\u5143\u7D20\u53D1\u751Fmargin\u6298\u53E0\u3002</li><li>\u7EDD\u5BF9\u5B9A\u4F4D\u5143\u7D20(absolute\u3001fixed)\u4E0D\u4F1A\u548C\u5176\u5B83\u5143\u7D20\u53D1\u751Fmargin\u6298\u53E0\u3002</li><li>display\u4E3Ainline-block\u7684\u5143\u7D20\u4E0D\u4F1A\u548C\u5176\u5B83\u5143\u7D20\u53D1\u751Fmargin\u6298\u53E0\u3002</li><li>\u5904\u4E8E\u666E\u901A\u6587\u6863\u6D41\u4E2D\u7684\u4E00\u4E2A\u5143\u7D20\u7684bottom margin\u603B\u4F1A\u548C\u5B83\u7684\u4E0B\u4E00\u4E2A\u5904\u4E8E\u666E\u901A\u6587\u6863\u6D41\u4E2D\u7684\u5144\u5F1F\u5143\u7D20\uFF08\u53EA\u8981\u8BE5\u5144\u5F1F\u5143\u7D20\u6CA1\u6709clear\uFF09\u7684top margin\u53D1\u751F\u6298\u53E0\u3002</li><li>\u5904\u4E8E\u666E\u901A\u6587\u6863\u6D41\u4E2D\u7684\u4E00\u4E2A\u5143\u7D20\uFF08\u6CA1\u6709top border\u548Ctop padding\uFF09\u7684top margin\u603B\u4F1A\u548C\u5B83\u7684\u7B2C\u4E00\u4E2A\u5904\u4E8E\u666E\u901A\u6587\u6863\u6D41\u4E2D\u7684\u5757\u7EA7\u5B50\u5143\u7D20\uFF08\u53EA\u8981\u8BE5\u5B50\u5143\u7D20\u6CA1\u6709clear\uFF09\u7684top margin\u53D1\u751F\u6298\u53E0\u3002</li></ul><p>\u5728margin\u53D1\u751F\u6298\u53E0\u7684\u60C5\u51B5\u4E0B\uFF0C\u8BA1\u7B97\u89C4\u5219\u5982\u4E0B\uFF1A</p><ul><li>\u5982\u679C\u53C2\u4E0E\u6298\u53E0\u7684margin\u90FD\u662F\u6B63\u503C\uFF0C\u5219\u53D6\u5176\u4E2D\u6700\u5927\u7684\u4F5C\u4E3A\u6298\u53E0\u540E\u7684margin\u503C\u3002</li><li>\u5982\u679C\u53C2\u4E0E\u6298\u53E0\u7684margin\u90FD\u662F\u8D1F\u503C\uFF0C\u5219\u53D6\u5176\u4E2D\u7EDD\u5BF9\u503C\u6700\u5927\u7684\u4F5C\u4E3A\u6298\u53E0\u540E\u7684margin\u503C\u3002</li><li>\u5982\u679C\u53C2\u4E0E\u6298\u53E0\u7684margin\u6709\u6B63\u6709\u8D1F\uFF0C\u5219\u53D6\u5176\u8D1F\u503C\u4E2D\u7EDD\u5BF9\u503C\u6700\u5927\u7684\u548C\u5176\u6B63\u503C\u4E2D\u6700\u5927\u7684\u76F8\u52A0\uFF0C\u4F5C\u4E3A\u6298\u53E0\u540E\u7684margin\u503C\u3002</li><li>\u5728\u8BA1\u7B97\u7684\u65F6\u5019\uFF0C\u8981\u5C06\u6240\u6709\u53C2\u4E0E\u6298\u53E0\u7684margin\u5728\u4E00\u8D77\u8BA1\u7B97\uFF0C\u4E0D\u80FD\u591F\u5206\u6B65\u8BA1\u7B97\u3002</li></ul><h2 id="_2-position" tabindex="-1">2. position <a class="header-anchor" href="#_2-position" aria-hidden="true">#</a></h2><ul><li>static\uFF1A\u5728\u666E\u901A\u6587\u6863\u6D41\u4E2D\uFF0C\u6B64\u65F6\u8BBE\u7F6Etop\uFF0Cright\uFF0Cbottom\u548Cleft\u4E0D\u8D77\u4F5C\u7528\u3002</li><li>relative\uFF1A\u5143\u7D20\u76F8\u5BF9\u4E8E\u5176\u5728\u666E\u901A\u6587\u6863\u6D41\u4E2D\u7684\u4F4D\u7F6E\u53D1\u751F\u504F\u79FB\uFF0C\u4F46\u662F\u8BE5\u5143\u7D20\u4ECD\u7136\u4FDD\u6301\u5B83\u5728\u666E\u901A\u6587\u6863\u6D41\u4E2D\u7684\u4F4D\u7F6E\u3002</li><li>absolute\uFF1A\u5143\u7D20\u8131\u79BB\u666E\u901A\u6587\u6863\u6D41\uFF0C\u76F8\u5BF9\u4E8E\u5176\u6700\u8FD1\u7684\u975Estatic\u7956\u5148\u5143\u7D20\u8FDB\u884C\u5B9A\u4F4D\u3002top\uFF0Cright\uFF0Cbottom\u548Cleft\u53EF\u5F71\u54CD\u5176\u4F4D\u7F6E\u548C\u5927\u5C0F(\u5F53\u672A\u8BBE\u7F6Ewidth\u548Cheight\u7684\u65F6\u5019)\u3002\u53E6\u5916\u8BE5\u60C5\u51B5\u4E0Bmargin\u4E0D\u4F1A\u53D1\u751F\u6298\u53E0\u3002</li><li>fixed\uFF1A\u4E0Eabsolute\u7C7B\u4F3C\uFF0C\u4E0D\u8FC7\u662F\u76F8\u5BF9\u4E8E\u53EF\u89C6\u7A97\u53E3\u8FDB\u884C\u5B9A\u4F4D\u3002\u5F53\u9875\u9762\u6EDA\u52A8\u7684\u65F6\u5019\uFF0C\u5143\u7D20\u76F8\u5BF9\u4E8E\u7A97\u53E3\u4F4D\u7F6E\u4FDD\u6301\u4E0D\u53D8\u3002</li></ul><h2 id="_3-float" tabindex="-1">3. float <a class="header-anchor" href="#_3-float" aria-hidden="true">#</a></h2><p>TBD</p><h2 id="_4-display\u3001position\u548Cfloat\u7684\u5173\u7CFB" tabindex="-1">4. display\u3001position\u548Cfloat\u7684\u5173\u7CFB <a class="header-anchor" href="#_4-display\u3001position\u548Cfloat\u7684\u5173\u7CFB" aria-hidden="true">#</a></h2><blockquote><p>\u672C\u90E8\u5206\u5185\u5BB9\u53C2\u8003 <a href="http://www.w3.org/TR/2011/REC-CSS2-20110607/visuren.html#dis-pos-flo" target="_blank" rel="noreferrer">http://www.w3.org/TR/2011/REC-CSS2-20110607/visuren.html#dis-pos-flo</a></p></blockquote><p>\u8FD9\u4E09\u4E2A\u5C5E\u6027\u4F1A\u76F8\u4E92\u4F5C\u7528\uFF0C\u4ECE\u800C\u5F71\u54CD\u6700\u91CD\u76D2\u5B50\u7684\u751F\u6210\u3002\u89C4\u5219\u5982\u4E0B\uFF1A</p><p><img src="'+a+'" alt=""></p><table><thead><tr><th>Specified value</th><th>Computed value</th></tr></thead><tbody><tr><td>inline-table</td><td>table</td></tr><tr><td>inline, table-row-group, table-column, table-column-group, table-header-group, table-footer-group, table-row, table-cell, table-caption, inline-block</td><td>block</td></tr><tr><td>others</td><td>same as specified</td></tr></tbody></table><h2 id="_5-visual-formatting-model" tabindex="-1">5. Visual formatting model <a class="header-anchor" href="#_5-visual-formatting-model" aria-hidden="true">#</a></h2><p>Visual formatting model\uFF08\u53EF\u89C6\u5316\u683C\u5F0F\u6A21\u578B\uFF0C\u4EE5\u4E0B\u7B80\u79F0VFM\uFF09\u662FCSS\u4E2D\u975E\u5E38\u91CD\u8981\u7684\u4E00\u4E2A\u6982\u5FF5\u3002\u53EF\u4EE5\u7406\u89E3\u4E3A\uFF0Cbox model\u786E\u5B9A\u4E86\u4E00\u4E2A\u5143\u7D20\u7684\u81EA\u8EAB\u7ED3\u6784\uFF0C\u800CVFM\u7528\u6765\u786E\u5B9A\u8FD9\u4E9Bbox\u5982\u4F55\u6392\u5217\u3002</p><p>\u5728VFM\u4E2D\uFF0C\u6BCF\u4E00\u4E2A\u5143\u7D20\u90FD\u4F1A\u6839\u636Ebox model\u4EA7\u751F\u96F6\u4E2A\u6216\u591A\u4E2Abox\uFF0C\u8FD9\u4E9Bbox\u7684\u5E03\u5C40\u53D7\u5230\u4EE5\u4E0B\u56E0\u7D20\u7684\u5F71\u54CD\uFF1A</p><ul><li>box\u7684size\u548Ctype</li><li>\u5B9A\u4F4D\u4F53\u7CFB\uFF1A\u666E\u901A\u6587\u6863\u6D41\u3001\u6D6E\u52A8\u3001\u7EDD\u5BF9\u5B9A\u4F4D</li><li>\u5728\u6587\u6863\u6811\u4E2D\uFF0C\u5143\u7D20\u4E4B\u95F4\u7684\u5173\u7CFB</li><li>\u5176\u5B83\u5916\u90E8\u4FE1\u606F\uFF0C\u4F8B\u5982viewport\u3001\u56FE\u7247\u7684\u56FA\u6709\u5C3A\u5BF8\u7B49</li></ul><p><strong>(1)\u5305\u542B\u5757(Containing block)</strong></p><p>\u8BB8\u591Abox\u7684\u5B9A\u4F4D\u548C\u5C3A\u5BF8\uFF0C\u53D6\u51B3\u4E8E\u4E00\u4E2A\u77E9\u5F62\u7684\u8FB9\u754C\uFF0C\u8BE5\u77E9\u5F62\u88AB\u79F0\u4F5C\u4E3A\u5305\u542B\u5757\uFF08containing block\uFF09\u3002\u4E00\u822C\u6765\u8BF4\uFF0C\u4E00\u4E2A\u5143\u7D20\u7684\u6240\u751F\u6210\u7684box\u4F1A\u4F5C\u4E3A\u8BE5\u5143\u7D20\u7684\u540E\u4EE3\u5143\u7D20\u7684\u5305\u542B\u5757\u3002\u540C\u65F6\u9700\u8981\u6CE8\u610F\u7684\u662F\uFF0C\u4E00\u4E2A\u5143\u7D20\u7684\u5305\u542B\u5757\u6307\u7684\u662F\u5305\u542B\u8BE5\u5143\u7D20\u7684\u5757\uFF0C\u800C\u975E\u7531\u8BE5\u5143\u7D20\u6240\u4EA7\u751F\u7684\u5757\u3002</p><p>\u6BCF\u4E2Abox\u76F8\u5BF9\u4E8E\u5B83\u7684\u5305\u542B\u5757\u90FD\u4F1A\u6709\u4E00\u4E2A\u5B9A\u4F4D\uFF0C\u4F46\u662Fbox\u4E0D\u4F1A\u88AB\u5B83\u7684\u5305\u542B\u5757\u6240\u9650\u5236\uFF0C\u5176\u5185\u5BB9\u6709\u53EF\u80FD\u6EA2\u51FA\uFF0C\u901A\u8FC7\u8BBE\u7F6Eoverflow\u7684\u503C\u53EF\u4EE5\u5904\u7406\u6EA2\u51FA\u3002</p><p>\u4E00\u4E2A\u5143\u7D20\u7684\u5305\u542B\u5757\u7684\u786E\u5B9A\u9075\u5FAA\u5982\u4E0B\u89C4\u5219\uFF1A</p><ul><li>\u6839\u5143\u7D20\u7684\u5305\u542B\u5757\u88AB\u79F0\u4E3A\u521D\u59CB\u5305\u542B\u5757\uFF08initial containing block\uFF09\uFF0C\u4E00\u822C\u6765\u8BF4\u5728HTML\u4E2D\u5C31\u662Fhtml\u5143\u7D20\u3002</li><li>position\u4E3Astatic\u6216relative\u7684\u5143\u7D20\u7684\u5305\u542B\u5757\u7531\u79BB\u5B83\u6700\u8FD1\u7684block container box\uFF08block\u3001table-cell\u3001inline-block\uFF09\u7684content box\u6240\u521B\u5EFA\u3002</li><li>position\u4E3Afixed\u7684\u5143\u7D20\u7684\u5305\u542B\u5757\u4E3A\u5F53\u524D\u7684viewport\u3002</li><li>position\u4E3Aabsolute\u7684\u5143\u7D20\u7684\u5305\u542B\u5757\u7531\u79BB\u5B83\u6700\u8FD1\u7684position\u4E3Arelative\u3001absolute\u6216fixed\u7684\u7956\u5148\u5143\u7D20\u521B\u5EFA\uFF1A <ul><li>\u5982\u679C\u7956\u5148\u5143\u7D20\u4E3Ainline\uFF0C\u5305\u542B\u5757\u4E3A\u7956\u5148\u5143\u7D20\u6240\u4EA7\u751F\u7684padding box\uFF0C\u540C\u65F6\u4E0E\u7956\u5148\u5143\u7D20\u7684direction\u6709\u5173\u3002</li><li>\u5426\u5219\u7531\u7956\u5148\u5143\u7D20\u7684padding box\u6240\u521B\u5EFA\u3002</li><li>\u5982\u679C\u4E0D\u5B58\u5728\u8FD9\u6837\u7684\u7956\u5148\u5143\u7D20\uFF0C\u90A3\u4E48\u5176\u5305\u542B\u5757\u5C31\u662F\u521D\u59CB\u5305\u542B\u5757\u3002</li></ul></li></ul><p><strong>(2)\u63A7\u5236\u6846(Controlling box)</strong></p><p>\u5757\u7EA7\u5143\u7D20\u548C\u5757\u6846\uFF08Block-level elements and block boxes\uFF09</p><ul><li>\u5F53\u4E00\u4E2A\u5143\u7D20\u7684display\u503C\u4E3Ablock\u3001list-item\u3001table\u7684\u65F6\u5019\uFF0C\u8BE5\u5143\u7D20\u4E3A\u5757\u7EA7\u5143\u7D20\u3002</li><li>\u6BCF\u4E2A\u5757\u7EA7\u5143\u7D20\u4F1A\u751F\u6210\u4E00\u4E2A\u4E3B\u5757\u6846\uFF08principal block-level box\uFF09\uFF0C\u4E3B\u5757\u6846\u4F1A\u4E3A\u5B50\u5B59\u5143\u7D20\u5EFA\u7ACB\u5305\u542B\u5757\uFF0C\u751F\u6210\u5185\u5BB9\uFF0C\u5E76\u4E14\u4E5F\u662F\u6D89\u53CA\u6240\u6709\u5B9A\u4F4D\u4F53\u7CFB\u7EDF\u7684\u6846\u3002\u6709\u4E9B\u5757\u7EA7\u5143\u7D20\u9664\u4E86\u4E3B\u5757\u6846\u4E4B\u5916\u8FD8\u4F1A\u4EA7\u751F\u989D\u5916\u7684\u6846\uFF0C\u4F8B\u5982display\u4E3Alist-item\u7684\u5143\u7D20\u3002</li><li>\u9664table\u5916\uFF0C\u5176\u5B83\u5757\u7EA7\u5143\u7D20\u4EA7\u751F\u7684\u4E3B\u5757\u6846\u4EC5\u5305\u542B\u5757\u6846\u6216\u4EC5\u5305\u542B\u884C\u5185\u6846\u3002</li></ul><p>\u884C\u5185\u5143\u7D20\u548C\u884C\u5185\u6846\uFF08Inline-level elements and inline boxes\uFF09</p><ul><li>\u5F53\u4E00\u4E2A\u5143\u7D20\u7684display\u503C\u4E3Ainline\u3001inline-table\u3001inline-block\u7684\u65F6\u5019\uFF0C\u8BE5\u5143\u7D20\u4E3A\u884C\u5185\u5143\u7D20\u3002</li></ul><p><strong>(3)\u8BA1\u7B97width\u548Cmargin</strong></p><p>\u975E\u66FF\u6362\u7684\u884C\u5185\u5143\u7D20\uFF08inline\uFF09\uFF1A</p><ul><li>width\u548Cheight\u8BBE\u7F6E\u65E0\u6548\uFF0C\u7531\u5185\u5BB9\u6491\u5F00\u3002\u9ED8\u8BA4\u7684margin-left\u548Cmargin-right\u4E3A0\u3002</li></ul><p>\u666E\u901A\u6587\u6863\u6D41\u4E2D\u7684\u975E\u66FF\u6362\u7684\u5757\u7EA7\u5143\u7D20\uFF08block\uFF09\uFF1A</p><ul><li>\u9996\u5148\u5404\u4E2A\u5C5E\u6027\u6EE1\u8DB3\u5982\u4E0B\u7B49\u5F0F\uFF1A<code>margin-left</code>+<code>border-left-width</code>+<code>padding-left</code>+<code>width</code>+<code>padding-right</code>+<code>border-right-width</code>+<code>margin-right</code>=<code>width of containing block</code></li><li>\u5982\u679Cwidth\u4E0D\u4E3Aauto\u4E14<code>border-left-width</code>+<code>padding-left</code>+<code>width</code>+<code>padding-right</code>+<code>border-right-width</code>\u8D85\u8FC7\u4E86\u5305\u542B\u5757\u7684\u5BBD\u5EA6\uFF0Cmargin-left\u548Cmargin-right\u7684auto\u503C\u4E3A0\u3002</li><li>\u5982\u679Cwidth\u3001margin-left\u3001margin-right\u90FD\u4E0D\u4E3Aauto\uFF0C\u6B64\u65F6margin-left\u548Cmargin-right\u5C06\u4E0D\u5B8C\u5168\u7B49\u4E8E\u8BBE\u5B9A\u503C\u3002\u5982\u679C\u5305\u542B\u5757\u7684direction\u662Fltr\uFF0C\u5219margin-right\u4F1A\u81EA\u52A8\u6539\u53D8\u4EE5\u6EE1\u8DB3\u7B49\u5F0F\uFF1B\u5982\u679C\u5305\u542B\u5757\u7684direction\u662Frtl\uFF0C\u5219margin-left\u4F1A\u81EA\u52A8\u6539\u53D8\u4EE5\u6EE1\u8DB3\u7B49\u5F0F\u3002</li><li>\u5982\u679Cwidth\u3001margin-left\u3001margin-right\u4E2D\u53EA\u6709\u4E00\u4E2A\u662Fauto\uFF0C\u90A3\u4E48\u8BE5\u503C\u4F1A\u81EA\u52A8\u6539\u53D8\u4EE5\u6EE1\u8DB3\u7B49\u5F0F\u3002</li><li>\u5982\u679Cwidth\u4E3Aauto\uFF0Cname\u8BBE\u7F6E\u4E3Aauto\u7684margin-left\u6216margin-right\u4E3A0\uFF0C\u6B64\u65F6width\u4F1A\u81EA\u52A8\u6539\u53D8\u4EE5\u6EE1\u8DB3\u7B49\u5F0F\u3002</li><li>\u5982\u679Cmargin-left\u548Cmargin-right\u90FD\u4E3Aauto\uFF0C\u5219\u8FD9\u4E24\u8005\u4F1A\u76F8\u7B49\uFF0C\u6B64\u65B9\u6CD5\u53EF\u4EE5\u7528\u6765\u4F7F\u5185\u5BB9\u5728\u5305\u542B\u5757\u4E2D\u6C34\u5E73\u5C45\u4E2D\u3002</li></ul><h2 id="_6-\u53C2\u8003" tabindex="-1">6. \u53C2\u8003 <a class="header-anchor" href="#_6-\u53C2\u8003" aria-hidden="true">#</a></h2><ul><li><a href="http://www.w3.org/TR/2011/REC-CSS2-20110607/box.html" target="_blank" rel="noreferrer">http://www.w3.org/TR/2011/REC-CSS2-20110607/box.html</a></li><li><a href="http://www.w3help.org/zh-cn/kb/006/" target="_blank" rel="noreferrer">http://www.w3help.org/zh-cn/kb/006/</a></li><li><a href="http://www.w3.org/TR/2011/REC-CSS2-20110607/visuren.html" target="_blank" rel="noreferrer">http://www.w3.org/TR/2011/REC-CSS2-20110607/visuren.html</a></li><li><a href="http://www.w3.org/TR/2011/REC-CSS2-20110607/visudet.html" target="_blank" rel="noreferrer">http://www.w3.org/TR/2011/REC-CSS2-20110607/visudet.html</a></li></ul>',42),d=[n];function p(g,s,h,m,c,b){return l(),t("div",null,d)}const w=i(r,[["render",p]]);export{f as __pageData,w as default};
